import { useState, useEffect } from "react";
import NavBarUser from './NavBarUser';
import { useLocation, useNavigate } from 'react-router-dom';

const FoodAndDrink = () => {
    const history = useNavigate();
    const [foodanddrink, setfoodanddrink] = useState([]);
    const [quantity, setQuantity] = useState();
    const [item, setItem]= useState();
    const [itemstatus, setitemstatus] = useState("Unclaimed");
    const [isPending, setIsPending] = useState(false);
    const [price, setPrice] = useState();
    const [totalAmount, setTotalAmount] = useState(0);
    const location = useLocation();
    const username = location.state.username;
    var loyaltypoint = location.state.loyaltypoint;
    var seatpref = location.state.seatpref;
    var id = location.state.id;

    useEffect(()=>{
        fetch('http://localhost:9000/foodanddrink')
        .then(res =>{
            return res.json();
        })
        .then(data => {
            setfoodanddrink(data);
        });
    },[]);

    const handleSubmit = (e) => {
        var customerid = id;
        const loyaltytransaction = {item, itemstatus, quantity, customerid};
        const total = selectedRecord.price * quantity;
        setTotalAmount(total.toFixed(2));
        e.preventDefault();
        setIsPending(true);
        
        fetch('http://localhost:8003/loyaltytransaction',{
            method: 'POST',
            headers: {"Content-Type": "application/json"},
            body: JSON.stringify(loyaltytransaction)
        }).then(()=>{
            console.log("Order have been placed");
            history('/user', {state:{username, loyaltypoint, seatpref, id}});
        })
    }
    

    return ( 
        <>
        
        <NavBarUser />

        <div style={{ backgroundColor: "black", color: "white", padding: "20px" }}>
        <h3>{username} food and drink</h3>
        <h1>Food and Drink Purchase Section</h1>
        <p>Select list of items to purchase:</p>
        <form onSubmit={handleSubmit}>
            <table>
            <thead>
                <tr>
                <th>Item name</th>
                <th>Item Description:</th>
                <th>Price</th>
                </tr>
            </thead>
            <tbody>
                {foodanddrink.map(record =>(
                <tr key={record.key}>
                    <td>{record.itemname}</td>
                    <td>{record.itemdesc}</td>
                    <td>${record.price.toFixed(2)}</td>
                </tr>
                ))}
            </tbody>
            </table>
            <label>Choose a combo:</label>
            <select value={item} onChange={(e)=> {
            setItem(e.target.value);
            const selectedRecord = foodanddrink.find(record => record.itemname === e.target.value);
            setPrice(selectedRecord.price.toFixed(2));
            }}>
            <option value="">Select a combo</option>
            {foodanddrink.map(current =>(
                <option key={current.key} value={current.itemname}>{current.itemname}</option>
            ))}
            </select>
            <label>Item Quantity: </label>
            <select value={quantity} onChange={(e)=>setQuantity(e.target.value)}>
            <option value="">Select a quantity</option>
            <option value="1">1</option>
            <option value="2">2</option>
            <option value="3">3</option>
            <option value="4">4</option>
            <option value="5">5</option>
            </select>
            <p>Total: ${totalAmount}</p>
            {!isPending && <button className="w3-button w3-light-grey w3-round-large w3-margin">Place Order</button>}
            {isPending && <button disabled className="w3-button w3-light-grey w3-round-large w3-margin-top">Submitting food and drink form...</button>}
        </form>
        </div>
        
        </>
        
     );
}
 
export default FoodAndDrink;
